using Microsoft.AspNetCore.Hosting.Server;
using Microsoft.AspNetCore.Mvc;

namespace DownloadPDF.Controllers
{
    [ApiController]
    [Route("[controller]")]
    public class WeatherForecastController : ControllerBase
    {
        private static readonly string[] Summaries = new[]
        {
            "Freezing", "Bracing", "Chilly", "Cool", "Mild", "Warm", "Balmy", "Hot", "Sweltering", "Scorching"
        };

        private readonly ILogger<WeatherForecastController> _logger;
        //private string base64String = "";
        private string base64String = "";

        public WeatherForecastController(ILogger<WeatherForecastController> logger)
        {
            _logger = logger;
        }

        [HttpGet(Name = "GetWeatherForecast")]
        public IEnumerable<WeatherForecast> Get()
        {
            return Enumerable.Range(1, 5).Select(index => new WeatherForecast
            {
                Date = DateOnly.FromDateTime(DateTime.Now.AddDays(index)),
                TemperatureC = Random.Shared.Next(-20, 55),
                Summary = Summaries[Random.Shared.Next(Summaries.Length)]
            })
            .ToArray();
        }

        [HttpPost]
        public ActionResult ConvertAndDownload(string fileType)
        {
            try
            {
                // Convert Base64 to bytes
                byte[] bytes = Convert.FromBase64String(base64String);

                // Determine the file extension based on the selected fileType
                string fileExtension = (fileType.ToLower() == "pdf") ? ".pdf" : ".jpg";

                // Generate a unique file name
                string fileName = Guid.NewGuid().ToString() + fileExtension;

                // Combine the file path
                string filePath = Path.Combine(@"C:\\TEST\\IMPORT", fileName);

                // Write bytes to the file
                System.IO.File.WriteAllBytes(filePath, bytes);

                // Return the file for download
                return File(filePath, "application/octet-stream", fileName);
            }
            catch (Exception ex)
            {
                return null;
            }
        }
    }
}
